    coeffs[53] = -2*d[0]*d[4]*d[12] + 2*d[4]*d[10]*d[12] - 2*d[1]*d[4]*d[13] + 2*d[4]*d[11]*d[13] + 2*d[2]*d[10] + 2*d[3]*d[11] - 2*d[10]*d[12] - 2*d[11]*d[13];
    coeffs[54] = d[1]*d[4]*d[10] - d[0]*d[4]*d[11] - d[1]*d[4]*d[12] + d[4]*d[11]*d[12] + d[0]*d[4]*d[13] - d[4]*d[10]*d[13] - d[3]*d[10] + d[2]*d[11] + d[3]*d[12] - d[11]*d[12] - d[2]*d[13] + d[10]*d[13];
    coeffs[55] = d[1]*d[2]*d[9] + d[0]*d[3]*d[9] + d[1]*d[5]*d[9] - d[3]*d[5]*d[9] - d[0]*d[6]*d[9] - d[2]*d[6]*d[9] + d[1]*d[2] + d[0]*d[3] - d[1]*d[7] + d[3]*d[7] - d[0]*d[8] - d[2]*d[8];
    coeffs[56] = -2*d[0]*d[2]*d[9] + 2*d[1]*d[3]*d[9] + 2*d[2]*d[5]*d[9] - 2*d[3]*d[6]*d[9] - 2*d[0]*d[2] + 2*d[1]*d[3] + 2*d[0]*d[7] - 2*d[1]*d[8];
    coeffs[57] = -d[1]*d[2]*d[9] - d[0]*d[3]*d[9] + d[1]*d[5]*d[9] + d[3]*d[5]*d[9] - d[0]*d[6]*d[9] + d[2]*d[6]*d[9] - d[1]*d[2] - d[0]*d[3] + d[1]*d[7] + d[3]*d[7] + d[0]*d[8] - d[2]*d[8];
    coeffs[58] = -2*d[1]*d[2]*d[5]*d[9] + 2*d[0]*d[2]*d[6]*d[9] - 2*d[0]*d[3]*d[7] + 2*d[0]*d[2]*d[8] + 2*d[1]*d[9] - 2*d[6]*d[9] + 2*d[3] - 2*d[8];
    coeffs[59] = -2*d[1]*d[3]*d[5]*d[9] + 2*d[0]*d[3]*d[6]*d[9] - 2*d[1]*d[3]*d[7] + 2*d[1]*d[2]*d[8] - 2*d[0]*d[9] + 2*d[5]*d[9] - 2*d[2] + 2*d[7];
    coeffs[60] = -d[1]*d[2]*d[9] + d[0]*d[3]*d[9] - d[1]*d[5]*d[9] - d[3]*d[5]*d[9] + d[0]*d[6]*d[9] + d[2]*d[6]*d[9] + d[1]*d[2] - d[0]*d[3] - d[1]*d[7] - d[3]*d[7] + d[0]*d[8] + d[2]*d[8];
